import React from "react"
import Axios from "axios"

function App(){
    const history = useHistory()

    function Handleclick(){
        window.open("http://localhost:1000/forms")
    }
    return(
        <div>
            <button onClick={Handleclick}>Click</button>
        </div>
    )
} 



export default App
